import React from 'react';

import './styles.css'

import {Link} from 'react-router-dom';

import {FiLogIn}from 'react-icons/fi';

import logoImg from '../../assets/LogoDemoShop.svg'; 

import VisaImg  from '../../assets/FudooLogon.png';

function Logon() {
  return (
    <div className="logon-contender">
    <section className="form">

        <img src={logoImg} alt="Demo Shop"/>

        <form>

            <h1>Faça seu Logon</h1>

            <input placeholder="Seu ID"/>
            <button className="button"type="submit">Entrar</button>

    
            <Link className="back-link"to="/carrinho">
                <FiLogIn size={16} color="rgba(222, 75, 75, 1)" />
                Não tenho cadastro
            </Link> 

        </form>

    </section>

    <img src={VisaImg} alt="Visa"/>
</div>
  );
}

export default Logon;
